info.description:
@-moz-document url("https://192.168.1.174/kvm/") {
    /* Change the theme color for the tab */
    :root {
        --theme-color: #91283b !important;
    }

    /* Apply the theme color */
    meta[name="theme-color"] {
        content: var(--theme-color) !important;
    }
}

